import React from "react";
import './news.css';

export const News = (props) => {
    console.log(props)
    return(
        <div className='container'>
            <div class="card">
                <div class="card-body" key={props.key}>
                <blockquote class="blockquote mb-0">
                    <img src={props.img} alt=''/>
                    <p>{props.article}</p>
                    <footer class="blockquote-footer"><span>{props.p}</span></footer>
                </blockquote>
                </div>
        </div>
      </div>
    )
}
